import React from 'react';
import { HashRouter, Route, Routes, Navigate } from 'react-router-dom';
import Header from './Header';
import NavBar from './NavBar';
import Home from './Home';
import About from './About';
import Resources from './Resources';
import Unit from './Unit';
import Page from './Page';
import CustomLink from './CustomLink'
import './App.css';
import subUnitRoutes from './SubUnitRoutes'

function App() {
  const subUnitList = topics.map(
    (list, unitIndex) => (
      <Route path = {`/unit${unitIndex+1}`} element={
        <Unit unit={unitIndex+1} subUnitList={
          list.map(
            (title, subUnitIndex) => (
              <li><CustomLink to={`/unit${unitIndex+1}/${subUnitIndex+1}`} className='subunit'>{title}</CustomLink></li>
            )
          )
        }/>
      }>
      </Route>)
    );

  return (
    <div className="app">
      <HashRouter>
        <Header />
        <NavBar />
        <Routes>
          <Route path="/" element={<Navigate to="/home" />} />
          <Route path="/home" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="/resources" element={<Resources />} />
          {subUnitList}
        </Routes>
        <SubUnitRoutes />
      </HashRouter>
    </div>
  );
}
export default App;
